  false,\n\t\"url\": null,\n\t\"notes\": \"This metadata document describes the collection
  and processing of Light Detection and Ranging (LIDAR) data over an area along the
  coast of Maine. Data was collected at a nominal two (2) meter post spacing between
  points. Two elevation data sets were compiled in this project, first surface returns,
  in which features that are above the ground, such as buildings, bridges, tree tops,
  etc. have not been eliminated and a Bare Earth Data set.\",\n\t\"license_title\":
